import base64
import hashlib
import random
import time
from Crypto.Cipher import AES

text = ""
cryptor = AES.new(b"lawyeecourtwensh", AES.MODE_CBC, b"lawyeecourtwensh")
text = base64.b64decode(text)
str = cryptor.decrypt(text).rstrip(b"\0")
print(str.decode("utf-8","ignore"))
